if mibBuilder.loadTexts: docsMcastAuthCmtsCmStatusTable.setDescription("This object maintains per-CM status of Multicast Authorization policies to be applied to this CM. The CM acquires these policy parameters through the CM registration process, or in the absence of some or all of those parameters, from the Ctrl Object. This object is meaningful when the Control Enable attribute is set to 'enable'. In the process of authorizing a CM client's session request the CMTS must check rules defined in StaticSessRule object and then rules defined in ProfileSessRule object. In the case of multiple multicast session matches, the rule priority attribute defines the final selected session rule. The selection of a session rules when multiple matches have the same priority is vendor specific. The CMTS MAY report in the CmtsCmStatus object CMs that do not signal any IP Multicast Authorization Encodings in the registration process. ")
